      out.write("\t\tfunction formatDateTime(inputTime) {\r\n");
      out.write("\t\t    var date = new Date(inputTime);\r\n");
      out.write("\t\t    var y = date.getFullYear();\r\n");
      out.write("\t\t    var m = date.getMonth() + 1;\r\n");
      out.write("\t\t    m = m < 10 ? ('0' + m) : m;\r\n");
      out.write("\t\t    var d = date.getDate();\r\n");
      out.write("\t\t    d = d < 10 ? ('0' + d) : d;\r\n");
      out.write("\t\t    var h = date.getHours();\r\n");
      out.write("\t\t    h = h < 10 ? ('0' + h) : h;\r\n");
      out.write("\t\t    var minute = date.getMinutes();\r\n");
      out.write("\t\t    var second = date.getSeconds();\r\n");
      out.write("\t\t    minute = minute < 10 ? ('0' + minute) : minute;\r\n");
      out.write("\t\t    second = second < 10 ? ('0' + second) : second;\r\n");
      out.write("\t\t    return y + '-' + m + '-' + d+' '+h+':'+minute+':'+second;\r\n");
      out.write("\t\t};\r\n");
      out.write("\r\n");
